import React from 'react';

export default function MembersActive(props){
    return(
        <section>
            <h3>{props.name}</h3>
            <p>Active Duration:</p>
            {
                props.period.forEach(item=>{
                    return(
                        <div>{item}</div>
                    );
                })
            }
            <button onClick={props.togglePopup}>CLOSE</button>
        </section>
    );
}
